North, Gary - Unholy Spirits, Occultism and New Age Humanism, 1986, 516 pages

This book is interesting because it presents a radically different view of modern occult practices. North's perspective can be best summed up by his own words, &quot;The one alternative to occultism that can preserve both freedom and scientific progress is orthodox Christianity.&quot; What more can I say?


